import {GET_PODCAST} from './actionTypes';
import axios from 'axios';

export const fetchPodcasts = () => async(dispatch) => {

  const podcast = await axios.get('/podcast').catch(e => {
    console.log(e);
  });

  console.log(podcast);

dispatch({
  type: GET_PODCAST,
  payload: podcast
});
};
